INSERT INTO `movie_info` VALUES ('A Bag of Marbles','http://developer.tmsimg.com/assets/p14247664_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-01-15',NULL,'01H','50M','A Jewish kid and his brother escape from the Nazis in occupied France.'),('A Fantastic Woman','http://developer.tmsimg.com/assets/p14534644_v_v5_ae.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-02-11','R','01H','43M','From the producers of Jackie, Spotlight and Toni Erdmann.'),('A Night of Comedy Shorts','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('A Quiet Place','http://developer.tmsimg.com/assets/p14660087_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-09','PG-13','01H','35M','In upstate New York, a couple and their two children must remain silent in their isolated farmhouse to avoid mysterious creatures that use sound to hunt their prey. Using sign language and eye contact to communicate, the family members must rely on one another -- and their wits -- to live to see the next day.'),('A Summer Place','http://developer.tmsimg.com/assets/p2111_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1959-10-22',NULL,'02H','10M','The big-screen adaptation of Sloan Wilson\'s popular novel follows wealthy Ken Jorgenson (Richard Egan) as he brings his wife (Constance Ford) and teenage daughter, Molly (Sandra Dee), to the Maine vacation spot where he worked as a middle-class youth. When Ken reunites with his former flame, the now-married Sylvia (Dorothy McGuire), it sparks a passionate tryst. Meanwhile, Sylvia\'s son, Johnny (Troy Donahue), and Molly begin a romance of their own, unaware of their parents\' affair.'),('A Wrinkle in Time','http://developer.tmsimg.com/assets/p14085794_v_v5_af.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-09','PG','01H','49M','Meg Murry and her little brother, Charles Wallace, have been without their scientist father, Mr. Murry, for five years, ever since he discovered a new planet and used the concept known as a tesseract to travel there. Joined by Meg\'s classmate Calvin O\'Keefe and guided by the three mysterious astral travelers known as Mrs. Whatsit, Mrs. Who and Mrs. Which, the children brave a dangerous journey to a planet that possesses all of the evil in the universe.'),('Acrimony','http://developer.tmsimg.com/assets/p14289024_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-30','R','02H','00M','When Melinda met Robert, she was skeptical of his charming nature but couldn\'t deny how attracted she was to him. Once they fell in love, Melinda molded herself into everything he wanted her to be. She sacrificed for him, worked to support his grandiose dreams, and put up with him for better or for worse. Then, one day she realized that after all she had done, another woman was reaping the lavish rewards. That\'s when Melinda lost it, and now she cannot let it go.'),('After Auschwitz','http://developer.tmsimg.com/assets/p14076494_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','23M','Hoping to find a sense of normalcy, six female Holocaust survivors immigrate to America, get married and raise children.'),('Amazon Adventure','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-04-18',NULL,'00H','45M','A true story of scientific discovery.'),('Amazon Adventure 3D','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-04-18',NULL,'00H','45M','A true story of scientific discovery.'),('An Evening With Brent Green','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Annihilation','http://developer.tmsimg.com/assets/p14433008_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-23','R','01H','55M','Lena, a biologist and former soldier, joins a mission to uncover what happened to her husband inside Area X -- a sinister and mysterious phenomenon that is expanding across the American coastline. Once inside, the expedition discovers a world of mutated landscapes and creatures, as dangerous as it is beautiful, that threatens both their lives and their sanity.'),('Au Hasard Balthazar','http://developer.tmsimg.com/assets/p22838_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1966-10-01',NULL,'01H','30M','Un Ã¢ne est entourÃ© d\'amour et de misÃ¨re.'),('Avengers: Infinity War','http://developer.tmsimg.com/assets/p12863030_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Avengers: Infinity War -- An IMAX 3D Experience','http://developer.tmsimg.com/assets/p12863030_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Avengers: Infinity War -- The IMAX 2D Experience','http://developer.tmsimg.com/assets/p12863030_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Avengers: Infinity War 3D','http://developer.tmsimg.com/assets/p12863030_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Baaghi 2','http://developer.tmsimg.com/assets/p15215156_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-30',NULL,'02H','17M','A battle-hardened army officer squares off against drug lords and Russian henchmen to save his ex-lover\'s kidnapped daughter in the underbelly of Goa, India.'),('Ballad of Orin','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','1977',NULL,'01H','49M','A blind traveling musician is abused and oppressed while she tours the country, even though the modern world imposes changes on people\'s behavior.'),('Beirut','http://developer.tmsimg.com/assets/p14757770_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-01-22','R','01H','49M','In 1980s Beirut, Mason Skiles is a former U.S. diplomat who is called back into service to save a colleague from the group that is possibly responsible for his own family\'s death. Meanwhile, a CIA field agent who is working under cover at the American embassy is tasked with keeping Mason alive and ensuring that the mission is a success.'),('Beyond the Clouds','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-13',NULL,'02H','00M','After a hedonistic teenager in Mumbai gets busted for dealing drugs, he moves in with his estranged sister.'),('Bharat Ane Nenu','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-19',NULL,'02H','53M',''),('Bhaskar Oru Rascal','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','32M',''),('Black Panther','http://developer.tmsimg.com/assets/p12878741_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-16','PG-13','02H','14M','After the death of his father, T\'Challa returns home to the African nation of Wakanda to take his rightful place as king. When a powerful enemy suddenly reappears, T\'Challa\'s mettle as king -- and as Black Panther -- gets tested when he\'s drawn into a conflict that puts the fate of Wakanda and the entire world at risk. Faced with treachery and danger, the young king must rally his allies and release the full power of Black Panther to defeat his foes and secure the safety of his people.'),('Black Panther 3D','http://developer.tmsimg.com/assets/p12878741_p_v5_ad.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-16','PG-13','02H','14M','After the death of his father, T\'Challa returns home to the African nation of Wakanda to take his rightful place as king. When a powerful enemy suddenly reappears, T\'Challa\'s mettle as king -- and as Black Panther -- gets tested when he\'s drawn into a conflict that puts the fate of Wakanda and the entire world at risk. Faced with treachery and danger, the young king must rally his allies and release the full power of Black Panther to defeat his foes and secure the safety of his people.'),('Blackmail','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018','','','','A man secretly blackmails his wife and her lover when he discovers the affair.'),('Blockers','http://developer.tmsimg.com/assets/p14659754_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-10','R','01H','42M','Julie, Kayla and Sam are three high school seniors who make a pact to lose their virginity on prom night. Lisa, Mitchell and Hunter are three overprotective parents who flip out when they find out about their daughters\' plans. They soon join forces for a wild and chaotic quest to stop the girls from sealing the deal -- no matter what the cost.'),('Blumhouse\'s Truth or Dare','http://developer.tmsimg.com/assets/p14814469_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','PG-13','01H','40M','Olivia, Lucas and a group of their college friends travel to Mexico for one last getaway before graduation. While there, a stranger convinces one of the students to play a seemingly harmless game of truth or dare with the others. Once the game starts, it awakens something evil -- a demon which forces the friends to share dark secrets and confront their deepest fears. The rules are simple but wicked -- tell the truth or die, do the dare or die, and if you stop playing, you die.'),('Borg vs. McEnroe','http://developer.tmsimg.com/assets/p13776100_v_v5_ay.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-07','R','01H','48M','The story of the rivalry between two 1980s tennis stars, the placid BjÃ¶rn Borg and the volatile John McEnroe.'),('Braguino','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'00H','49M','A feud develops between two families in the Siberian forest.'),('Cake','http://developer.tmsimg.com/assets/p15219338_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','05M',''),('Call Me by Your Name','http://developer.tmsimg.com/assets/p14169043_v_v5_ao.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-01-22','R','02H','12M','It\'s the summer of 1983, and precocious 17-year-old Elio Perlman is spending the days with his family at their 17th-century villa in Lombardy, Italy. He soon meets Oliver, a handsome doctoral student who\'s working as an intern for Elio\'s father. Amid the sun-drenched splendor of their surroundings, Elio and Oliver discover the heady beauty of awakening desire over the course of a summer that will alter their lives forever.'),('Chappaquiddick','http://developer.tmsimg.com/assets/p14580275_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-10','PG-13','01H','41M','On July 18, 1969, Sen. Ted Kennedy drives his car off of a bridge on Massachusetts\' Chappaquiddick Island. The accident results in the death of passenger Mary Jo Kopechne, a 28-year-old campaign strategist who worked for Kennedy. The ongoing investigation into the mysterious and scandalous events forever alters Kennedy\'s political legacy -- and ultimately changes the course of presidential history.'),('Cobra Kai Premiere Event Feat. The Karate Kid','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','','','02H','45M','Ralph Macchio, Noriyuki \"Pat\" Morita and Elisabeth Shue star in the classic 1984 film \"The Karate Kid\"; includes the premiere of the first two episodes of the related series \"Cobra Kai,\" featuring the return of Macchio and actor William Zabka.'),('Corbin Nash','http://developer.tmsimg.com/assets/p15213356_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-20','','01H','34M','A New York City cop transfers to Los Angeles to hunt for his parents\' killer. Once there, he\'s brutally murdered and returns to life as the ultimate killer.'),('Disobedience','http://developer.tmsimg.com/assets/p14781041_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-10','R','01H','54M','Photographer Ronit Krushka returns to the community that shunned her decades earlier for her childhood attraction to a female friend. Their reunion soon reignites their passion as they explore the boundaries of faith and sexuality.'),('Diya','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','20M',''),('Dude\'s Manual','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Faces Places','http://developer.tmsimg.com/assets/p14554158_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-19','PG','01H','29M','Director AgnÃ¨s Varda and photographer and muralist JR journey through rural France and form an unlikely friendship.'),('Final Portrait','http://developer.tmsimg.com/assets/p14347252_v_v5_ah.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017','R','01H','30M','In 1964, artist Alberto Giacometti asked writer James Lord to sit for a portrait. He said it would take only one day.'),('Finding Your Feet','http://developer.tmsimg.com/assets/p15000428_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-11-24','PG-13','01H','51M','When \"Lady\" Sandra Abbott discovers that her husband of 40 years is having an affair with her best friend, she seeks refuge in London with her estranged, older sister Bif. The two could not be more different - Sandra is a fish out of water next to her outspoken, serial dating, free-spirited sibling. But different is just what Sandra needs at the moment, and she reluctantly lets Bif drag her along to a community dance class, where she starts finding her feet.'),('Ghost Stories','http://developer.tmsimg.com/assets/p15305825_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-05',NULL,'01H','37M','Professor Phillip Goodman devotes his life to exposing phony psychics and fraudulent supernatural shenanigans. His skepticism soon gets put to the test when he receives news of three chilling and inexplicable cases -- disturbing visions in an abandoned asylum, a car accident deep in the woods and the spirit of an unborn child. Even scarier -- each of the macabre stories seems to have a sinister connection to the professor\'s own life.'),('Godard Mon Amour','http://developer.tmsimg.com/assets/p14840253_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-21','R','01H','47M','During the making of one of his films, French film director Jean-Luc Godard falls in love with 17-year-old actress Anne Wiazemsky and later marries her.'),('Godard, mon amour','http://developer.tmsimg.com/assets/p14840253_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-21','R','01H','47M',''),('Gonjiam: Haunted Asylum','http://developer.tmsimg.com/assets/p15288125_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13',NULL,'01H','33M','The crew of a horror web series travels to an abandoned asylum for a live broadcast. It soon encounters much more than expected as it moves deeper inside the nightmarish old building.'),('Grace Jones: Bloodlight and Bami','http://developer.tmsimg.com/assets/p15047130_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-07',NULL,'01H','56M','Electrifying concert performances and intimate, personal footage showcase the life and talent of singer and actress Grace Jones.'),('Hitler\'s Hollywood','http://developer.tmsimg.com/assets/p13922929_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-07',NULL,'01H','45M','Narrated by Udo Kier. A film by RÃ¼diger Suchsland, maker of From Caligari to Hitler.'),('I Can Only Imagine','http://developer.tmsimg.com/assets/p14462292_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-16','PG','01H','50M','Growing up in Greenville, Texas, Bart Millard suffers physical and emotional abuse at the hands of his father, Arthur. When Arthur becomes terminally ill, he finds redemption by embracing his faith and rediscovering his love for his son. Years later, Bart\'s troubled childhood and mended relationship with his dad inspires him to write the hit song \"I Can Only Imagine\" as singer of the Christian band MercyMe.'),('I Feel Pretty','http://developer.tmsimg.com/assets/p14992717_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-20','PG-13','01H','50M','An ordinary woman who struggles with feelings of insecurity and inadequacy on a daily basis wakes from a fall believing she is suddenly the most beautiful and capable woman on the planet. With this newfound confidence, she is empowered to live her life fearlessly and flawlessly, but what will happen when she realizes her appearance never changed?'),('IMAX VR: Eagle Flight Multiplayer','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: Justice League VR: Aquaman, Batman, Superman','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: Nickelodeon Slime Zone','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: Raw Data Multiplayer','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: Richie\'s Plank Experience','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: Space Flight: Orbital Emergency','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: Star Trek Bridge Crew','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('IMAX VR: The Unspoken','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Isle of Dogs','http://developer.tmsimg.com/assets/p14551155_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-15','PG-13','01H','41M','When, by executive decree, all the canine pets of Megasaki City are exiled to a vast garbage-dump called Trash Island, 12-year-old Atari sets off alone in a miniature Junior-Turbo Prop and flies across the river in search of his bodyguard-dog, Spots. There, with the assistance of a pack of newly-found mongrel friends, he begins an epic journey that will decide the fate and future of the entire Prefecture.'),('Ismael\'s Ghosts','http://developer.tmsimg.com/assets/p14760102_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017','R','01H','54M','Twenty-one years ago, she ran away -- and 21 years later, Carlotta is back from the void. But Ismael has been busy rebuilding a life for himself with Sylvia and working on his next movie. As Ismael\'s trials and tribulations unfurl, so too do those of his film\'s protagonist -- the idle, funny and reckless diplomat Ivan DÃ©dalus.'),('Itzhak','http://developer.tmsimg.com/assets/p14995769_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-05',NULL,'01H','23M','The life and music of Israeli conductor and musician Itzhak Perlman.'),('Jeannette: The Childhood of Joan of Arc','http://developer.tmsimg.com/assets/p14447360_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-21',NULL,'01H','45M','Young shepherdess Jeannette, the future Joan of Arc, already carries the weight of the the French nation on her shoulders as she grapples with matters of the soul.'),('John McEnroe: In the Realm of Perfection','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'','','John McEnroe faces Ivan Lendl in the final of the 1984 French Open.'),('Kanam','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','20M',''),('Kodachrome','http://developer.tmsimg.com/assets/p15198321_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-08',NULL,'01H','40M','Matt, a struggling executive, finds his world turned upside down when his estranged father\'s nurse shows up unexpectedly in his office. Matt\'s father, a famed bad-boy photojournalist, is facing terminal cancer and his dying wish is for Matt to join him on a road trip from New York to Kansas to process his last rolls of Kodachrome film before the sole remaining lab closes and those captured moments are gone forever.'),('L\'enfant secret','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','1979',NULL,'01H','32M','Four stories from the birth of a secret child.'),('Le Corbeau','http://developer.tmsimg.com/assets/p5616_b_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1943-09-28',NULL,'01H','32M','Le docteur RÃ©my Germain travaille dans une petite ville de province paisible, tellement paisible qu\'on a l\'impression parfois d\'y Ã©touffÃ©. Et soudain le scandale arrive : plusieurs habitants reÃ§oivent des lettres anonymes. Cruelles, mensongÃ¨res, grossiÃ¨res : ces missives touchent un peu tout le monde. Seul point commun, une signature : `Le Corbeau\'.'),('Lean on Pete','http://developer.tmsimg.com/assets/p14841156_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-01','R','02H','02M','Charley, a teenager living with his single father, cares for an ageing racehorse named Lean On Pete. When he learns Pete is bound for slaughter, the two embark on an odyssey across the new American frontier in search of a place to call home.'),('Liquid Sky','http://developer.tmsimg.com/assets/p49734_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1982','R','01H','52M','An alien creature invades New York\'s punk subculture in its search for an opiate released by the brain during orgasm.'),('Little Pink House','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-02-03',NULL,'01H','39M','A Connecticut nurse finds herself at the center of a political firestorm and a Supreme Court case centering on eminent domain.'),('Lou Andreas-SalomÃ©','http://developer.tmsimg.com/assets/p13052635_st_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2016',NULL,'01H','53M','Lou Andreas-SalomÃ©, geboren 1861 in der russischen Stadt St. Petersburg, entschlieÃŸt sich schon in jungen Jahren, niemals zu heiraten und sich ganz der Bildung und ihrer intellektuellen Entwicklung zu widmen. Bald tritt sie in Kontakt mit berÃ¼hmten Philosophen wie Friedrich Nietzsche und Paul RÃ©e, die von ihr fasziniert sind. Mit Sigmund Freuds Hilfe wird sie eine angesehene Psychoanalytikerin. Doch dem noch unbekannten Dichter Rainer Maria Rilke gelingt es, ihr Herz zu gewinnen.'),('Love After Love','http://developer.tmsimg.com/assets/p14787163_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-04-22',NULL,'01H','31M','A mother and her two adult sons try to regain their emotional equilibrium after the death of their family\'s patriarch.'),('Love, Simon','http://developer.tmsimg.com/assets/p14651974_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-27','PG-13','01H','50M','Everyone deserves a great love story, but for 17-year-old Simon Spier, it\'s a little more complicated. He hasn\'t told his family or friends that he\'s gay, and he doesn\'t know the identity of the anonymous classmate that he\'s fallen for online. Resolving both issues proves hilarious, terrifying and life-changing.'),('Mercury','http://developer.tmsimg.com/assets/p15349554_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','','01H','48M','Maimed from mercury poisoning, five longtime friends come together for a high school reunion, and it turns into nonstop terror.'),('Rampage','http://developer.tmsimg.com/assets/p13499890_p_v5_an.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','PG-13','01H','47M','Primatologist Davis Okoye shares an unshakable bond with George, an extraordinarily intelligent, silverback gorilla that\'s been in his care since birth. When a rogue genetic experiment goes wrong, it causes George, a wolf and a reptile to grow to a monstrous size. As the mutated beasts embark on a path of destruction, Okoye teams up with a discredited genetic engineer and the military to secure an antidote and prevent a global catastrophe.'),('Rampage 3D','http://developer.tmsimg.com/assets/p13499890_p_v5_an.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','PG-13','01H','47M','Primatologist Davis Okoye shares an unshakable bond with George, an extraordinarily intelligent, silverback gorilla that\'s been in his care since birth. When a rogue genetic experiment goes wrong, it causes George, a wolf and a reptile to grow to a monstrous size. As the mutated beasts embark on a path of destruction, Okoye teams up with a discredited genetic engineer and the military to secure an antidote and prevent a global catastrophe.'),('Rampage: The IMAX 2D Experience','http://developer.tmsimg.com/assets/p13499890_p_v5_an.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','PG-13','01H','47M','Primatologist Davis Okoye shares an unshakable bond with George, an extraordinarily intelligent, silverback gorilla that\'s been in his care since birth. When a rogue genetic experiment goes wrong, it causes George, a wolf and a reptile to grow to a monstrous size. As the mutated beasts embark on a path of destruction, Okoye teams up with a discredited genetic engineer and the military to secure an antidote and prevent a global catastrophe.'),('Ready Player One','http://developer.tmsimg.com/assets/p12806300_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-11','PG-13','02H','20M','In 2045, the planet is on the brink of chaos and collapse, but people find salvation in the OASIS, an expansive virtual reality universe created by James Halliday. When Halliday dies, he promises his immense fortune to the first person to discover a digital Easter egg that\'s hidden somewhere in the OASIS. When young Wade Watts joins the contest, he finds himself becoming an unlikely hero in a reality-bending treasure hunt through a fantastical world of mystery, discovery and danger.'),('Ready Player One 3D','http://developer.tmsimg.com/assets/p12806300_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-29','PG-13','02H','20M','In 2045, the planet is on the brink of chaos and collapse, but people find salvation in the OASIS, an expansive virtual reality universe created by James Halliday. When Halliday dies, he promises his immense fortune to the first person to discover a digital Easter egg that\'s hidden somewhere in the OASIS. When young Wade Watts joins the contest, he finds himself becoming an unlikely hero in a reality-bending treasure hunt through a fantastical world of mystery, discovery and danger.'),('Ready Player One: An IMAX 3D Experience','http://developer.tmsimg.com/assets/p12806300_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-29','PG-13','02H','20M','In 2045, the planet is on the brink of chaos and collapse, but people find salvation in the OASIS, an expansive virtual reality universe created by James Halliday. When Halliday dies, he promises his immense fortune to the first person to discover a digital Easter egg that\'s hidden somewhere in the OASIS. When young Wade Watts joins the contest, he finds himself becoming an unlikely hero in a reality-bending treasure hunt through a fantastical world of mystery, discovery and danger.'),('Sgt. Stubby: An American Hero','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','PG','01H','25M','With World War I looming, Robert Conroy, a young Army private, adopts a stray, stump-tailed terrier. Conroy names his new friend Stubby and gives him a home, a family, and a chance to embark on the adventure that would define a century. The two quickly find themselves in the trenches of France and on the path to history. French soldier Gaston Baptiste befriends the man and dog and accompanies them along their epic journey through harsh conditions and incredible acts of courage.'),('Sherlock Gnomes','http://developer.tmsimg.com/assets/p13794695_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-23','PG','01H','26M','When Gnomeo and Juliet first arrive in London with their friends and family, their biggest concern is getting a new garden ready for spring. When everyone in the garden suddenly goes missing -- there\'s only one gnome to call -- Sherlock Gnomes. The famous detective and sworn protector of the city shows up with his sidekick Watson to investigate the case. The mystery soon leads the gnomes on a rollicking adventure as they meet all-new ornaments and explore an undiscovered side of London.'),('Silence','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','1971',NULL,'02H','09M','Two Portuguese priests go to Japan to help Christian sects, driven underground by a ruthless magistracy, to regain a foothold. Quickly drawn into a mire of persecution, the missionaries soon learn the fate of a mission decades earlier.'),('Super Troopers 2','http://developer.tmsimg.com/assets/p14477928_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-20','R','01H','43M','Fired for their previous shenanigans, former Vermont Highway Patrol officers Thorny, Farva, Rabbit, Foster and Mac get a shot at redemption from Capt. O\'Hagan and Gov. Jessan. The wacky quintet must provide law enforcement for a French Canadian town that\'s transitioning to U.S. sovereignty. Their unconventional methods soon get put to the test when they encounter a smarmy mayor, mischievous Mounties, a smuggling ring and a 1,300-pound bear.'),('Sympathy for the Devil','http://developer.tmsimg.com/assets/p5976_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1968',NULL,'01H','39M','Scenes from the Rolling Stones\' recording studio sessions are interspersed with footage of the Vietnam War.'),('The Cat Returns -- Studio Ghibli Fest 2018','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','','','01H','25M','A dapper feline takes a lucky schoolgirl on a magical adventure in the anime film \"The Cat Returns\"; dubbed in English on April 22 and April 25, and subtitled on April 23.'),('The Death of Stalin','http://developer.tmsimg.com/assets/p14589654_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-08','R','01H','47M','When tyrannical dictator Joseph Stalin dies in 1953, his parasitic cronies square off in a frantic power struggle to become the next Soviet leader. Among the contenders are the dweebish Georgy Malenkov, the wily Nikita Khrushchev and Lavrenti Beria -- the sadistic secret police chief. As they bumble, brawl and back-stab their way to the top, the question remains -- just who is running the government?'),('The Devil and Father Amorth','http://developer.tmsimg.com/assets/p15076386_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-08-31',NULL,'01H','08M','Filmmaker William Friedkin follows the Rev. Gabriele Amorth as he performs an exorcism on a woman in Italy.'),('The Exorcist','http://developer.tmsimg.com/assets/p6107_v_v5_ay.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1973-12-26','R','02H','02M','One of the most profitable horror movies ever made, this tale of an exorcism is based loosely on actual events. When young Regan (Linda Blair) starts acting odd -- levitating, speaking in tongues -- her worried mother (Ellen Burstyn) seeks medical help, only to hit a dead end. A local priest (Jason Miller), however, thinks the girl may be seized by the devil. The priest makes a request to perform an exorcism, and the church sends in an expert (Max von Sydow) to help with the difficult job.'),('The IMAX VR: Justice League VR: Cyborg Flash, Wonder Woman','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('The Killers','http://developer.tmsimg.com/assets/p4181_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1946-08-28',NULL,'01H','45M','Two hit men walk into a diner asking for a man called \"the Swede\" (Burt Lancaster). When the killers find the Swede, he\'s expecting them and doesn\'t put up a fight. Since the Swede had a life insurance policy, an investigator (Edmond O\'Brien), on a hunch, decides to look into the murder. As the Swede\'s past is laid bare, it comes to light that he was in love with a beautiful woman (Ava Gardner) who may have lured him into pulling off a bank robbery overseen by another man (Albert Dekker).'),('The Miracle Season','http://developer.tmsimg.com/assets/p14953815_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-06','PG','01H','39M','Based on the inspiring true story of the West High School girl\'s volleyball team. After the tragic loss of star player Caroline \"Line\" Found in an accident, the remaining team players must band together under the guidance of their tough-love coach, Kathy Bresnahan, in hopes of winning the state championship.'),('The Rider','http://developer.tmsimg.com/assets/p14671211_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-20','R','01H','44M','After a riding accident leaves him unable to compete on the rodeo circuit, a young cowboy searches for a new purpose.'),('The Shape of Water','http://developer.tmsimg.com/assets/p14064584_v_v5_ad.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-08-31','R','02H','03M','Elisa is a mute, isolated woman who works as a cleaning lady in a hidden, high-security government laboratory in 1962 Baltimore. Her life changes forever when she discovers the lab\'s classified secret -- a mysterious, scaled creature from South America that lives in a water tank. As Elisa develops a unique bond with her new friend, she soon learns that its fate and very survival lies in the hands of a hostile government agent and a marine biologist.'),('This Is Our Land','http://developer.tmsimg.com/assets/p14297094_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','57M','A nurse gets involved in a far right political party.'),('Traffik','http://developer.tmsimg.com/assets/p14514003_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-20','R','01H','36M','Brea and John embark on a romantic weekend getaway to an isolated estate in the mountains. They are pleasantly surprised when two of their friends, Darren and Malia, also show up unexpectedly. Their plans for fun soon give way to terror when members of a violent biker gang invade the peaceful countryside. Banded together, they now find themselves in a fight for their lives as their assailants will stop at nothing to protect their secrets from the outside world.'),('Tyler Perry\'s Acrimony','http://developer.tmsimg.com/assets/p14289024_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-30','R','02H','00M','When Melinda met Robert, she was skeptical of his charming nature but couldn\'t deny how attracted she was to him. Once they fell in love, Melinda molded herself into everything he wanted her to be. She sacrificed for him, worked to support his grandiose dreams, and put up with him for better or for worse. Then, one day she realized that after all she had done, another woman was reaping the lavish rewards. That\'s when Melinda lost it, and now she cannot let it go.'),('Unsane','http://developer.tmsimg.com/assets/p14830399_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-20','R','01H','38M','Sawyer Valentini relocates from Boston to Pennsylvania to escape from the man who\'s been stalking her for the last two years. While consulting with a therapist, Valentini unwittingly signs in for a voluntary 24-hour commitment to the Highland Creek Behavioral Center. Her stay at the facility soon gets extended when doctors and nurses begin to question her sanity. Sawyer now believes that one of the staffers is her stalker -- and she\'ll do whatever it takes to stay alive and fight her way out.'),('Veneno','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'01H','36M','Jack Veneno becomes the most famous Dominican wrestler of all time and faces his archrival, Relampago Hernandez.'),('VR: Eagle Flight','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('VR: Raw Data V1.1','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Wanderland','http://developer.tmsimg.com/assets/p15373362_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','29M','Seeking an escape from his isolated life in New York, Alex accepts a mysterious invitation to house-sit a picturesque cottage on Long Island.'),('Where Is Kyra?','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-01-23',NULL,'01H','38M','A fragile woman is already stressed from a fast-paced world when her mother dies and she must find a means for survival while hiding her struggles from her new boyfriend.'),('You Were Never Really Here','http://developer.tmsimg.com/assets/p14834818_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-27','R','01H','30M','When a teenage girl goes missing, a jaded, brutal enforcer attempts a rescue mission. He uncovers corruption and abuse of power along his way.'),('Zama','http://developer.tmsimg.com/assets/p14591881_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-08-30',NULL,'01H','55M','No fim do sÃ©culo XVIII, Don Diego de Zama Ã© um oficial da Coroa Espanhola que deseja partir para Buenos Aires. Ele junta-se a um grupo de soldados Ã  caÃ§a de um perigoso bandido e explora terras distantes habitadas por Ã­ndios selvagens.');
